		/// <summary>
		/// Archive an exist 'real' logs except today's log if it exists.
		/// If there is no log for today one is created.
		/// </summary>
		/// <param name="webLogDir">Dir to create log in</param>
		/// <param name="tempDir">Dir to move existing logs to during test</param>
		/// <returns></returns>
		private string PrepareLogDir( string webLogDir, string tempDir )
		{
			try
			{
				if (Directory.Exists(TempDir))
					Directory.Delete(TempDir, true);

				Directory.CreateDirectory(TempDir);
			}
			catch (Exception exception)
			{
				Assert.IsTrue(false,
					String.Format("Failed to create temp directory - {0}", exception.Message));

			}
			

			TDDateTime now = new TDDateTime(System.DateTime.Now);
			string year = now.Year.ToString().Substring(2, 2);
			string month =  now.Month.ToString();
			string day = now.Day.ToString();
			string hour = now.Hour.ToString();
			
			if (month.Length == 1)
				month = "0" + month;

			if (day.Length == 1)
				day = "0" + day;

			if (hour.Length == 1)
				hour = "0" + hour;

			string currentFile = "ex" + year + month + day + hour + ".log";
			string currentFilepath = webLogDir + "\\" + currentFile;

			bool currentFileExists = false;

			try
			{
				string[] files = Directory.GetFiles( webLogDir );				
				foreach( string file in files ) 
				{
					
					if ( file != currentFilepath )
					{
						// Move the file
						string[] splitFileName = file.Split('\\');
						File.Move( file, tempDir + "\\" + splitFileName[splitFileName.Length - 1] );
					}
					else if ( file == ( webLogDir + currentFile ) )
					{
						currentFileExists = true;
					}
				}
			}
			catch (Exception ex)
			{
				Assert.IsTrue(false,
					String.Format( "File Move failed - {0}", ex.Message.ToString()));
			}

			if (!currentFileExists)
			{
				// create a dummy file for today
				StreamWriter logToday = new StreamWriter( File.OpenWrite( webLogDir + currentFile ) );
				logToday.WriteLine( "#Software: Microsoft Internet Information Services 5.0" );
				logToday.WriteLine( "#Version: 1.0" );
				logToday.WriteLine( "#Date: " + "2004-04-16 08:46:13" );
				logToday.WriteLine( "#Fields: date time c-ip cs-username s-ip s-port cs-method cs-uri-stem cs-uri-query sc-status sc-bytes cs-bytes cs(User-Agent) cs(Cookie) cs(Referer) " );
				logToday.WriteLine( "2004-04-16 14:59:40 127.0.0.1 - 127.0.0.1 80 GET /peno/PostExample.aspx - 200 1298 886 Mozilla/5.0+(Windows;+U;+Windows+NT+5.0;+en-US;+rv:1.4)+Gecko/20030624 MSCSProfile=983BB0CC620F5E6D8FDE26829663AF16D90C0921FFC2257E5EF1391D39AC5476524C01419CE7BF7975A1DE0391101778A96A689E630B12F9609B4613D852C687B3B7EA714FD168ABEE0FBBA1359BA0578919F191DB31B4678FF39133867A5ED7A8F582895DF817E85A1BFBA4D9F25B0156866EC13BBF64AD3D2E4144E192CC048D6101E9251FD787;+Commerce2002_TestPersistentCookie=TestCookie;+Commerce2002_TestSessionCookie=TestCookie;+ASP.NET_SessionId=g3qcaz55n41h3vjtk3vjbhj3 -" );
				logToday.Close();
			}

			return currentFile;
		}

