		[Test]
		public void TestGMTDateTimeProcessing()
		{

			// Delete any existing TD Trace log files
			try
			{
				string[] logFiles = Directory.GetFiles(this.OutputDir, "WebLogReader*");				
				foreach( string s in logFiles ) File.Delete( s );
			}
			catch (Exception ex)
			{
				Assert.IsTrue(false,
					"Failed deleting old trace output log files - " + ex.Message.ToString());
			}


			// Delete any existing files in the archive directory
			try
			{
				string[] archiveFiles = Directory.GetFiles(this.ArchiveDir);				
				foreach( string s in archiveFiles ) File.Delete( s );
			}
			catch (Exception ex)
			{
				Assert.IsTrue(false,
					"Failed deleting old archive files - " + ex.Message.ToString());
			}


			try
			{
				CreateTestLogFile6(this.WebLogDir);
				
			}
			catch (Exception)
			{
				Assert.IsTrue(false, "Failed to create test file 6.");
			}

			int returnCode = 0;

			string[] args = new String[0];
			returnCode = WebLogReaderMain.Main(args);
			
			Console.WriteLine( "Return Code =  " + returnCode );
			
			Assert.IsTrue( returnCode == 0 );

			// File in the output dir relates to web log reader
			string[] files = Directory.GetFiles(this.OutputDir, "WebLogReader*");
			Assert.IsTrue(files.Length == 1);

			// There are correct number of entries in the logging file for the number lines taken from the web log file
			StreamReader srOutput = File.OpenText( files[0] );
			String input;
			string[] inputLines = new string[1000];
			int totalCount = 0;
			int lineCount = 0;
			while ( ( input = srOutput.ReadLine() ) != null ) 
			{
				if( input.Substring( 0, 13 ) == "WorkloadEvent" )
				{
					string count = input.Substring( 47, 1 ); // NB only allows single digits in test data ie num of events in a min cannot exceed 9
					totalCount = totalCount + int.Parse(count);
					inputLines[lineCount] = input;
					lineCount++;
				}
			}
			srOutput.Close();
			Console.WriteLine( "Workload aggregate count = " + totalCount );
			
			// Ensure correct date data stored (ie one hour has been added to reflect BST)
			Assert.IsTrue( totalCount == expectedWorkloadEventsFile6 );
			Assert.IsTrue(inputLines[0].Equals("WorkloadEvent,'2003-09-17 09:46:00.000000000','1'"));
			Assert.IsTrue(inputLines[1].Equals("WorkloadEvent,'2003-09-18 01:00:00.000000000','1'"));
		}

		[Test]
		public void TestLargeFile()
		{

			// Delete any existing files in the archive directory
			try
			{
				string[] archiveFiles = Directory.GetFiles(this.ArchiveDir);				
				foreach( string s in archiveFiles ) File.Delete( s );
			}
			catch (Exception ex)
			{
				Assert.IsTrue(false, String.Format("Failed deleting old archive files - {0}", ex.Message.ToString()) );
			}
			
			string[] files = null;

			// Delete any existing TD Trace log files
			try
			{
				files = Directory.GetFiles(this.OutputDir, "WebLogReader*");				
				foreach( string s in files ) File.Delete( s );
			}
			catch (Exception ex)
			{
				Assert.IsTrue( false, "Failed deleting old trace output log files - " + ex.Message.ToString() );
			}

			try
			{
				CreateTestLogFile7(this.WebLogDir);		
			}
			catch (Exception)
			{
				Console.WriteLine("Failed creating test file 7", false );
			}

			int returnCode = 0;

			string[] args = new String[0];

			DateTime startTime = DateTime.Now;
			returnCode = WebLogReaderMain.Main(args);
			TimeSpan timeTaken = new TimeSpan(0);

			Console.WriteLine( "Return Code =  " + returnCode );
			Assert.IsTrue( returnCode == 0 );

			files = Directory.GetFiles(this.OutputDir, "WebLogReader*");
			Assert.IsTrue(files.Length == 1);

			StreamReader srOutput = File.OpenText( files[0] );
			int totalCount = 0;
			string input;
			while ( ( input = srOutput.ReadLine() ) != null ) 
			{
				if( input.Substring( 0, 13 ) == "WorkloadEvent" )
				{
					string count = input.Substring( 47, 6 ); // NB only allows values of 6 digits in length
					totalCount = totalCount + int.Parse(count);
				}
			}

			srOutput.Close();
			Console.WriteLine( "Workload aggregate count = " + totalCount );
			
			Assert.IsTrue(totalCount == expectedWorkloadEventsFile7,
				"Expected number of workload events incorrect.");
			
			try
			{
				timeTaken = DateTime.Now - startTime;
			}
			catch (Exception e)
			{
				Assert.IsTrue(false,"Failed to calculate time taken to process large web log file." + e.Message.ToString());
			}

			Console.WriteLine("Time taken to process large web log file containing  " + expectedWorkloadEventsFile7.ToString() + " workload events: " + timeTaken.ToString());
		}

