		/// <summary>
		/// Tests the WebLogReaderController.run method with 1 or 2 files.
		/// </summary>
		private void ProcessFiles(int numOfFiles)
		{	
			// Array for file names
			string[] files = null;

			// Delete any existing files in the archive directory
			try
			{
				files = Directory.GetFiles(this.ArchiveDir);				
				foreach( string s in files ) File.Delete( s );
			}
			catch (Exception ex)
			{
				Assert.IsTrue( false, "Failed deleting old archive files - " + ex.Message.ToString() );
			}

			// Delete any existing TD Trace log files
			try
			{
				files = Directory.GetFiles(this.OutputDir, "WebLogReader*");				
				foreach( string s in files ) File.Delete( s );
			}
			catch (Exception ex)
			{
				Assert.IsTrue( false, "Failed deleting old trace output log files - " + ex.Message.ToString() );
			}
					
			// Create test web log file.
			try
			{
				if (numOfFiles == 1)
				{
					CreateTestLogFile1(this.WebLogDir);
				}
				else if (numOfFiles == 2)
				{
					CreateTestLogFile1(this.WebLogDir);
					CreateTestLogFile2(this.WebLogDir);
				}
				else
				{
					// do not create any files
				}
			}
			catch (Exception)
			{
				Assert.IsTrue( false, "Failed to create test files 1 and/or 2");
			}

			int returnCode = 0;

			// RUN THE WEB LOG READER VIA THE CONTROLLER
			WebLogReaderController controller = new WebLogReaderController(Properties.Current);
			returnCode = controller.Run();
			
			Console.WriteLine( "Return Code =  " + returnCode );
		
			Assert.IsTrue( returnCode == 0 );

			// Processed File is in Archive Dir
			if ((numOfFiles == 1) || (numOfFiles == 2)) 
				Assert.IsTrue( File.Exists( this.ArchiveDir + "\\" + TestWebLogFilename1 ) );

			if (numOfFiles == 2)
				Assert.IsTrue( File.Exists( this.ArchiveDir + "\\" + TestWebLogFilename2 ) );

			// Processed File is not in Log Dir
			if ((numOfFiles == 1) || (numOfFiles == 2)) 
				Assert.IsTrue( !File.Exists( this.WebLogDir + "\\" + TestWebLogFilename1 ) );

			if (numOfFiles == 2)
				Assert.IsTrue( !File.Exists( this.WebLogDir + "\\" + TestWebLogFilename2 ) );

			// Active File has not been processed
			Assert.IsTrue( !File.Exists( this.ArchiveDir + fileNameActive ) );

			// Active File is in Web Log Dir
			Assert.IsTrue( File.Exists( this.WebLogDir + fileNameActive ) );

			// File in the output dir relates to web log reader
			files = Directory.GetFiles(this.OutputDir, "WebLogReader*");
			Assert.IsTrue(files.Length == 1);

			// There are correct number of entries in the logging file for the number lines taken from the web log file
			StreamReader srOutput = File.OpenText( files[0] );
			String input;
			int totalCount = 0;
			while ( ( input = srOutput.ReadLine() ) != null ) 
			{
				if( input.Substring( 0, 13 ) == "WorkloadEvent" )
				{
					string count = input.Substring( 47, 1 ); // NB only allows single digits in test data ie num of events in a min cannot exceed 9
					totalCount = totalCount + int.Parse(count);
				}
			}
			srOutput.Close();
			Console.WriteLine( "Workload aggregate count = " + totalCount );
			
			if (numOfFiles == 1)
				Assert.IsTrue(totalCount == expectedWorkloadEventsFile1,
					"Expected number of workload events incorrect.");
			else if (numOfFiles == 2)
				Assert.IsTrue(totalCount == (expectedWorkloadEventsFile1 + expectedWorkloadEventsFile2),
					"Expected number of workload events incorrect.");
			else if (numOfFiles == 0)
				Assert.IsTrue(totalCount == 0,
					"Expected number of workload events incorrect.");
		}

		/// <remarks>
		/// Manual setup:
		/// IIS configured to log W3C format files to the directory c:\winnt\system32\logfiles\w3svc1
		/// Ensure that IIS has been configured to roll web logs over on an HOURLY basis.
		/// Ensure the 'Use local time for file naming and rollover' checkbox is ticked.
		/// Restart IIS after making configuration change.
		/// MSMQ exists with name TDPrimaryQueue.
		/// The following directory must exist: c:\winnt\system32\logfiles\w3svc1\Archive
		/// </remarks>
		[Test]
		[Ignore("Manual setup required")]
		public void ManualSetup()
		{}
	}	
		
